import React from 'react'

const cont = (props) => {
    function formSub()
    {
        let name = document.getElementById("Name").value;
        alert("Form Submittted");
    }
  return (
    <div>
        <form className='NameForm' onSubmit='formSub'>
            <label>Name: </label>
            <input className='Name' id='Name' type="text"></input>
        </form>
        {props.name}
    </div>
  )
}

export default cont
